import React from 'react'

export const Add = () => {
  return (
    <div className='add-page'>
      <h1></h1>
      <div className='container'>
        <div className='add-content'>
          <div className='input-wrapper'>
            <input type='text' placeholder='Search movie..... '/>
          </div>
        </div>
      </div>
    </div>
  );
};
